В наличии  2021 года выпуска TESLA MODEL 3 PERFORMANCE AWD, полный привод, 516 л.с.

Новый, без пробега, сертифицированный электромобиль от официального Представительства TESLA в Европе.

Не входит в список налога на роскошь. Нет транспортного налога в Москве, Московской, Липецкой, Калужской и др. областях.

Парковки в Москве и области бесплатные, зарядка на публичных зарядных станциях в Москве и области бесплатная.

Ускорение - 3,3 секунды от 0 до 100 км/ч

Дальность пробега на одной зарядке - 567 км

Максимальная скорость - 260 км/ч (ограничена электроникой)

Обновления 2021 года:

Двойные стекла на передних дверях

Электропривод открытия заднего багажника

Матовые молдинги кузова и ручки на дверях (антихром)

Беспроводная зарядка для телефона

Тепловой насос в большой батарее

Европейская версия (пробег - в километрах, температура - в градусах Цельсия, навигация активирована, работает в режиме онлайн, зарядное устройство совместимо со стандартной сетью России/ три фазы, 220, 380 вольт). Европейский тип разъёма CCS (TYPE 2/COMBO 2 : Максимальная мощность зарядки составляет 250 кВт, Напряжение до 1000 В и ток больше 350 А).

Европейская гарантия на электромобиль - 4 года или 80.000 км, гарантия на батарею и двигатели - 8 лет.

КОМПЛЕКТАЦИЯ:

ДВА ЭЛЕКТРОМОТОРА на передней и задней осях (полный привод);

ЦВЕТ - Красный (Red Multi-Coat);

САЛОН - черная кожа;

СПОЙЛЕР из карбона на крышке заднего багажника;

ПРЕМИУМ ПАКЕТ (кожаный салон, подогрев сидений, салонное зеркало заднего вида с авто-затемнением, обогрев боковых зеркал заднего вида, эл. складывающиеся боковые зеркала заднего вида, панорамная крыша, регулируемые электрические сидения по 12-ти направлениям, USB разъёмы, премиум аудиосистема с 15-тью аудиоколонками, включая сабвуфер);

базовый АВТОПИЛОТ 3.0 (поддержание заданной скорости и дистанции на дороге с соблюдением требований ПДД к данной местности, автоматическая параллельная парковка,);

КОЛЁСНЫЕ диски R"20

СИСТЕМА Автоматического аварийного торможения и предупреждения о столкновении;

8 подушек безопасности;

ESP и Traction контроль;

15" сенсорный дисплей с навигационной системой"

Доступ в салон без ключа (keyless entry), пластиковая карта вместо традиционного ключа;

Голосовое управление;

60/40 складывающиеся сидения второго ряда.
